import { RECEIVE_ADDRESS } from '../../actions/bc_actions';

const addressReducer = (state = {}, action) => {
    Object.freeze(state)
    switch(action.type) {
        case RECEIVE_ADDRESS:

        case RECEIVE_BLOCKCOUNT:

        default:
            return state
    }
}

export default addressReducer
